import React, { Component } from 'react'


export default class OnePage extends Component {
    constructor(props) {
        super(props);
        this.state = {
          one: {
            input: [],
            sum:  0,
          }

        }
      }
      randomInput = () => {
        const n = this.randomNumber();
        let arr = [];
        for (let index = 0; index < n; index++) {
          arr.push(this.randomNumber);
        }
        return arr;
      }
      randomNumber = () => {
        return Math.floor(Math.random() * 20);
      }
      resultQuestionOne(){
        const input = [1,2,3,4]
        console.log(input);

        // const sum = input.reduce((acc, current) => acc + current, 0);
        // console.log(sum);

        this.setState({
          input: [1,2,3],
          sum: 10
        })
      }
      render() {
        const { one } = this.state;
        return (
          <div>
            <h1> QUESTION 1: </h1>
            <h2>
              Input random array: {one.input.toString()}
            </h2>
            <button onClick={() => this.resultQuestionOne()}>
                Result One
            </button>
            <h2>
                {one.sum.toString()}
            </h2>
          </div>
        )
      }
}
